module.exports = "<div class=\"container-scroller\">\n  <div class=\"container-fluid page-body-wrapper full-page-wrapper\">\n    <div class=\"content-wrapper d-flex align-items-center auth px-0\">\n      <div class=\"row w-100 mx-0\">\n        <div class=\"col-lg-4 mx-auto\">\n          <div class=\"auth-form-light py-5 px-4 px-sm-5\">\n            <div class=\"text-center\">\n              <a routerLink=\"/\" class=\"brand-logo\">\n                <img src=\"./assets/images/logo-dark.png\" alt=\"logo\">\n              </a>\n            </div>\n            <div *ngIf=\"notConfirmed\" class=\"mt-2 mb-5\">\n              <div class=\"alert alert-warning\" role=\"alert\">\n                <h3 class=\"alert-heading\">Hey there!</h3>\n                <p class=\"lead\"><strong>Your email address has not been confirmed.</strong></p>\n                <hr>\n                <p class=\"lead\">A confirmation email has been sent to your email address.</p>\n                <p class=\"mb-0 lead\">Please check your email and click on the activation link to continue. Thank You!</p>\n              </div>\n            </div>\n\n            <div *ngIf=\"authFailed\" class=\"mt-2 mb-5\">\n              <div class=\"alert alert-danger\" role=\"alert\">\n                <h3 class=\"alert-heading\">Hey there!</h3>\n                <p class=\"lead\"><strong>Failed to send an authentication code to your phone.</strong></p>\n                <hr>\n                <p class=\"mb-0\">Please make sure you have an active ionternet connection or our servers may be down.</p>\n              </div>\n            </div>\n\n            <div *ngIf=\"notClient\" class=\"mt-2 mb-5\">\n              <div class=\"alert alert-danger\" role=\"alert\">\n                <h3 class=\"alert-heading\">Hey there!</h3>\n                <p class=\"lead text-left\"><strong>Please login in as another user. Click the link below.</strong></p>\n              </div>\n            </div>\n\n            <div *ngIf=\"deactivated\" class=\"mt-2 mb-5\">\n              <div class=\"alert alert-danger\" role=\"alert\">\n                <h3 class=\"alert-heading\">Hey there!</h3>\n                <p class=\"lead\"><strong>Your account has been deactivated.</strong></p>\n                <hr>\n                <p class=\"mb-0 lead\">Please contact your admin.</p>\n              </div>\n            </div>\n\n            <h4 class=\"text-center\">Hello! let's get started.</h4>\n            <h6 class=\"font-weight-nromal text-center\">Sign in to continue.</h6>\n            <form [formGroup]=\"form\" (ngSubmit)=\"login()\" class=\"pt-3\">\n              <div class=\"form-group\">\n                <input type=\"text\" class=\"form-control form-control-lg\" formControlName=\"username\"\n                  placeholder=\"Username or Email Address\" [ngClass]=\"{'input-control-error': submitted && f.username.errors}\">\n                <div *ngIf=\"submitted && f.username.errors\">\n                  <p class=\"input-error\" *ngIf=\"f.username.errors.required\">Username is required</p>\n                </div>\n              </div>\n              <div *ngIf=\"userNotFound\" class=\"mt-2\">\n                <div class=\"alert alert-danger alert-dismissible fade show\" role=\"alert\">\n                  <strong>User Not Found!</strong> Mmm!, this email address doesnt have an account with us\n                  <button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\">\n                    <span aria-hidden=\"true\">&times;</span>\n                  </button>\n                </div>\n              </div>\n              <div class=\"form-group\">\n                <input type=\"password\" class=\"form-control form-control-lg\" formControlName=\"password\"\n                  placeholder=\"Password\" [ngClass]=\"{'input-control-error': submitted && f.password.errors}\">\n                <div *ngIf=\"submitted && f.password.errors\">\n                  <p class=\"input-error\" *ngIf=\"f.password.errors.minlength\">Password must be atleast 6 characters</p>\n                  <p class=\"input-error\" *ngIf=\"f.password.errors.required\">Password is required</p>\n                </div>\n              </div>\n              <div *ngIf=\"invalidPassword\" class=\"mt-2\">\n                <div class=\"alert alert-danger alert-dismissible fade show\" role=\"alert\">\n                  <strong>Invalid Password!</strong> Oh no, this isn't your password. Please check and try again.\n                  <button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\">\n                    <span aria-hidden=\"true\">&times;</span>\n                  </button>\n                </div>\n              </div>\n              <div class=\"mt-3\">\n                <button type=\"submit\" *ngIf=\"!loading\" class=\"btn btn-block btn-primary btn-lg font-weight-medium auth-form-btn\">SIGN IN</button>\n                <button type=\"button\" *ngIf=\"loading\" class=\"btn btn-block btn-primary btn-lg font-weight-medium auth-form-btn\" disabled>\n                  <span class=\"spinner-border spinner-border-sm\" role=\"status\" aria-hidden=\"true\"></span> &nbsp; &nbsp;\n                  Please wait...\n                </button>\n              </div>\n              <div class=\"mt-3 text-center\">\n                <a routerLink=\"/forgot\" class=\"auth-link text-black\">Forgot password?</a>\n              </div>\n              <div class=\"text-center mt-4 font-weight-light\">\n                Don't have an account? <a routerLink=\"/register\" class=\"text-primary\">Signup</a>\n              </div>\n              <div class=\"row mt-3\">\n                <div class=\"col-12\">\n                  <div class=\"text-center\">\n                    <a class=\"text-primary\" routerLink=\"/terms\">Terms & Conditions</a> &nbsp; | &nbsp;\n                    <a class=\"text-primary\" routerLink=\"/privacy\">Privacy Policies</a>\n                  </div>\n                </div>\n              </div>\n              <!-- <div class=\"mt-3 text-center\">\n                <a routerLink=\"/user_auth\" class=\"auth-link text-primary\">Login as other user?</a>\n              </div> -->\n            </form>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!-- content-wrapper ends -->\n  </div>\n  <!-- page-body-wrapper ends -->\n</div>\n"

